import React, { Fragment, useState, useEffect } from "react";
import Table from "react-bootstrap/Table";

const StudentCurd = () => {
  const [Data, Setdata] = useState();
  console.log("set data:", Data);

  const rows = [
    {
      Id: 1,
      Name: "Swara",
      age: 23,
      Address: "pune",
      Class: "second",
      SkillId: 1,
    },
    {
      Id: 2,
      Name: "Sunita",
      age: 23,
      Address: "pune",
      Class: "second",
      SkillId: 4,
    },
    {
      Id: 3,
      Name: "Mira",
      age: 23,
      Address: "pune",
      Class: "second",
      SkillId: 5,
    },
  ];
  const HandleEdit = (Id) => {
    if (window.confirm(" Edit Your message...") == true) {
      alert(Id);
    }
  };
  const HandleDelete = (Id) => {
    if (window.confirm("Are You sure to delete message...") == true) {
      alert(Id);
    }
  };

  useEffect(() => {
    Setdata(rows);
  }, []);
  return (
    <Fragment>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
            <th>Age</th>
            <th>Address</th>
            <th>Class</th>
            <th>SkillId</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {rows && rows.length > 0
            ? rows.map((item, index) => {
                return (
                  <>
                    <tr key={index}>
                      <td>{index + 1}</td>
                      <td>{item.Name}</td>
                      <td>{item.age}</td>
                      <td>{item.Address}</td>
                      <td>{item.Class}</td>
                      <td>{item.SkillId}</td>
                      <td colSpan={2}>
                        <button
                          className="btn btn-primary"
                          onClick={HandleEdit}
                        >
                          Edit
                        </button>{" "}
                        &nbsp;
                        <button
                          className="btn btn-danger"
                          onClick={HandleDelete}
                        >
                          Delete
                        </button>
                      </td>
                    </tr>
                  </>
                );
              })
            : "...Loading"}
        </tbody>
      </Table>
    </Fragment>
  );
};

export default StudentCurd;
